  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(fetchMovies());
  }, [dispatch]);

  return (
    <div className="app-container">
      <h1 className="app-title">Movies App</h1>

      <div className="card">
        <MovieForm />
      </div>

      <div className="card">
        <MovieImport />
      </div>

      <div className="card">
        <MovieList />
      </div>
    </div>
  );
}
